<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Document</title>
    <style>
        .shop-card {
            width: fit-content;
            padding: 2rem 3rem;
            border-radius: 20px;
            box-shadow: rgba(0, 0, 0, 0.24) 0px 3px 8px;
        }

        .info {
            margin-top: 2rem;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            font-size: 30px;
        }

        .info span {
            font-size: 20px;
        }
    </style>
</head>

<body>
    <h2>Feature Items</h2>
    <div>
        <div class="shop-card">
            <img src="data:image/jpeg;base64,"
                alt="">
            <div class="info">
                Name
                <span>price</span>
            </div>
        </div>
    </div>
</body>

</html>
